import './App.css';
import SearchPhotos from "./searchPhotos"

function App() {
  return (
    <div className="App">
       <div className="container">
        <h1 className="title">React Photo Search</h1>
      </div>

      <SearchPhotos/>
    </div>
  );
}

export default App;
